        private static Texture2D LoadBase64String(string base64PNG)
        {
            Texture2D pic  = new Texture2D(1024, 1024);
            byte[]    data = System.Convert.FromBase64String(base64PNG);
            pic.LoadImage(data);
            byte[] bytes = pic.EncodeToPNG();
            return pic;
        }

